import HeaderVue from './HeaderVue'
import {LeftOutlined} from '@ant-design/icons-vue'


export default {
    install(app) {
        app.component(HeaderVue.name,HeaderVue)
        app.component("LeftOutlined",LeftOutlined)
    }
}
